import { MechParams } from "../params";
export class AesCbcParams {
    constructor(iv, data = Buffer.alloc(0)) {
        this.type = MechParams.AesCBC;
        this.iv = iv;
        this.data = data;
    }
    toCKI() {
        return this.iv;
    }
}
export class AesCbcEncryptDataParams {
    constructor(iv, data = Buffer.alloc(0)) {
        this.type = MechParams.AesCBC;
        this.iv = iv;
        this.data = data;
    }
    toCKI() {
        return {
            type: this.type,
            iv: this.iv,
            data: this.data,
        };
    }
}
